import React, { Component } from 'react';
import img from './2.jpg';

import './home.css';
import Photoplay from './photoplay';

class Home extends Component {

    render() {
        return (
            <div>
                <Photoplay />   {/* 引入图片轮播组件*/}
                <section className="new-product">
                    <p><b>最新上市</b></p>
                    <div className="new-product-msg">
                        <div className="new-product-info x">
                            <div className="">1
                                {/* <a href="http://baidu.com" >wqd</a> */}
                                <div></div>
                                <div>
                                    <img src={img} alt="21"></img>
                                </div>
                            </div>
                        </div>

                        <div className="new-product-info x">2</div>
                        <div className="new-product-info d">3</div>
                        <div className="new-product-info x">4</div>
                        <div className="new-product-info x">5</div>
                        <div className="new-product-info d">6</div>
                    </div>
                </section>

                <section className="special-product">
                    <p><b>特别推荐</b></p>
                    <div className="special-product-msg">
                        <div className="special-product-info x">
                            <div className="">
                                {/* <a href="http://baidu.com" >wqd</a> */}
                                <div></div>
                                <div>
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Home;
